import React from 'react';

const Page3 = ({ story, quote }) => {
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-green-900 text-white">
      <h1 className="text-2xl">Quotify</h1>
      <p className="mt-4">Write down your story!</p>
      <input 
        type="text" 
        value={story} 
        readOnly 
        className="mt-4 p-2 rounded bg-gray-700"
      />
      <div className="mt-4 p-4 bg-orange-600 rounded">
        <p className="text-center">"{quote}"</p>
        <p className="text-center">- Mahatma Gandhi</p>
      </div>
    </div>
  );
};

export default Page3;
